  "Broker Comment" : "OTHER RELATED ITEMS 22D3 & 22D4; U4 DISCLOSES THAT ON NOVEMBER 25, 1968, ZICKLIN WAS CENSURED AND DISASSOCIATED FROM MERRILL LYNCH FOR 21 DAYS, COMMENCING DECEMBER 5, 1968; SEC ADMINISTRATIVE PROCEEDING NO. 3-1680; SEC RELEASE NO. 8549. MERRILL LYNCH AND CERTAIN EMPLOYEES, WHO IN CONNECTION WITH PROSPECTIVE UNDERWRITING BY \"REGISTRANT\", RECEIVED INFORMATION CONCERNING SUBSTANTIAL REDUCTION IN ISSUER'S EARNINGS, DISCLOSED SUCH INFORMATION TO CERTAIN OF REGISTRANT'S CUSTOMERS WHO, PRIOR TO THIS PUBLIC DISSEMINATION, EFFECTED SALES AND SHORT SALES OF SECURITIES OF ISSUER. THE SEC HELD THIS TO BE A VIOLATION OF ANTI-FRAUD PROVISIONS OF THE SECURITIES LAWS AND ACCEPTED THE OFFER OF SETTLEMENT OF \"REGISTRATION\" AND CERTAIN OTHER EMPLOYEES."
}
